import React from 'react';
import ListItem from '../list-item/ListItem';

const List = ({ pokemons }) => {
    let all = [];

    const allPokemons = async () => {
        const all = await pokemons;
        all.results.map(pokemon => <ListItem pokemon={pokemon} />)
    }

    return (
        <ul>
            {allPokemons()}
        </ul>
    )
}

export default List;
